import React from 'react'
import {Card, Avatar, Row } from 'antd'
import {HeartOutlined,CommentOutlined, DislikeOutlined, HeartFilled } from '@ant-design/icons'
const { Meta } = Card;

const BlogCard = (props) => {

    return (
        <>
        {console.log("image link",props.image)}
        <Card
          style={{width:"300px", borderRadius:"20px"}}
          cover={
            <img
              style={{width:"300px", height:"200px"}}
              alt="example"
              src={props.image}
            />
          }
          actions={[

              <HeartOutlined key="like" onClick={<HeartFilled/>}/>,
              <CommentOutlined key="comment" />,
              <DislikeOutlined key="dislike" />,
          ]}
        >
          <Meta
            avatar={
              <Avatar src={props.avatar} />
            }
            title={props.title}
            description={
              <div>
                <p style={{ marginBottom: "0" }}>Posted by - {props.name}</p>
                <p style={{ marginBottom: "0" }}>{props.description}</p>
              </div>
            }
          />
        </Card>
      </>
    )
}

export default BlogCard
